import React, {Component} from 'react'
import './OptionsList.css'

class OptionsList extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div>
                <p>My Patients</p>
                <p>Aquire Patients</p>
            </div>
        )
    }
}

export default OptionsList;
